import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';

import { loadData, selectFilteredAllVerbs } from '../app/verbsSlice';

import createVerbObject from '../functions/loadingFunctions';

const AllVerbs = () => {

   const allVerbs = useSelector(selectFilteredAllVerbs);
   const dispatch = useDispatch();

   const onFirstRender = () => {
      // console.log(createVerbObject())
     dispatch(loadData(createVerbObject()));
   }
   useEffect(onFirstRender, []);

   return (
      <div>
         Hello there!
         <form>
            <input type='checkbox' id='tense1' value='present' />
            <label for='tense1'> Present</label>
         </form>
      </div>
   )
}

export default AllVerbs
